export default function ProductCard() {
  return (
    <div className="bg-white w-4/6 m-5 py-5 border">
      <img
        src="https://img.freepik.com/free-photo/chicken-wings-barbecue-sweetly-sour-sauce-picnic-summer-menu-tasty-food-top-view-flat-lay_2829-6471.jpg"
        className="w-full transition scale-[95%] hover:scale-100 delay-300"
      />
      <div className="flex justify-between m-4">
        <h2 className="pt-4">Samsung Gallaxy J10</h2>
        <button className="bg-red text-white px-4 py-2 rounded-md transition-all hover:shadow-md scale-[95%] hover:scale-100">
          Add to Cart
        </button>
      </div>
    </div>
  );
}
